import math

def fib_primes(n):

    def is_prime(num):
        if num <= 1:
            return False
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                return False
        return True
    fib = [0, 1]
    while fib[-1] < n:
        num = fib[-1] + fib[-2]
        if num > n:
            break
        fib.append(num)
    return [num for num in fib[2:] if is_prime(num)]

